  fetch("/about")
  .then((res) => res.render('about'))
  .then(res => setData(res))
}, []);

  return (
    <div className="CRM">
      <header className="CRM">
        <p>
          {
            !data ? "Loading..." : data
          }
        </p>
      </header>
    </div>
  );
}

export default App;
